package metrics;

import E_ART.Encryption;
import utilities.Key;

public class AvalancheEffect {
    private static final int pairCount = 4;
    private static final int[] keyPair1 = new int[]{68, 52, 80, 52};
    private static final int[] keyPair2 = new int[]{69, 53, 81, 53};

    public static String convertStringToBinary(String input) {
        StringBuilder result = new StringBuilder();
        char[] chars = input.toCharArray();
        for (char aChar : chars) {
            result.append(
                    String.format("%8s", Integer.toBinaryString(aChar)).replaceAll(" ", "0")
            );
        }
        return result.toString();
    }

    public static int hammingDist(String cipher1, String cipher2) {
        int count = 0;
        for (int i = 0; i < cipher1.length(); i++) {
            if (cipher1.charAt(i) != cipher2.charAt(i)) {
                count++;
            }
        }
        return count;
    }

    public static float calculate(String plainText) {
        float avgHammingDist = 0;
        for (int i = 0; i < pairCount; i++) {
            String cipher1 = Encryption.encrypt(new Key(keyPair1[i], 9), plainText);
            String cipher2 = Encryption.encrypt(new Key(keyPair2[i], 9), plainText);

            String binary1 = convertStringToBinary(cipher1);
            String binary2 = convertStringToBinary(cipher2);

            int hD = hammingDist(binary1, binary2);
            System.out.println("HD: " + hD);

            avgHammingDist += ((float) (hD)) / ((float) binary1.length());
        }
        return ((avgHammingDist / pairCount) * 100);
    }

    public static void main(String[] args) {
        System.out.println("Avalanche Effect: " + calculate("\n") + "%");
    }
}